import React from 'react';
import './VerticalLink.css';

export default function VerticalLink (){
    return(
        <div className="VerticalLink-folder-container">
            {/* GitHub */}
            <div className="VerticalLink-folder-item">
                <a href="https://github.com/tu-usuario" target="_blank" rel="noopener noreferrer">
                    <img src="ruta-a-tu-imagen-de-github" alt="GitHub" className="folder-image" />
                    <p className="folder-title">GitHub</p>
                </a>
            </div>

            {/* LinkedIn */}
            <div className="VerticalLink-folder-item">
                <a href="https://www.linkedin.com/in/tu-perfil" target="_blank" rel="noopener noreferrer">
                    <img src="ruta-a-tu-imagen-de-linkedin" alt="LinkedIn" className="folder-image" />
                    <p className="folder-title">LinkedIn</p>
                </a>
            </div>

            {/* Email */}
            <div className="VerticalLink-folder-item">
                <img src="ruta-a-tu-imagen-de-email" alt="Email" className="folder-image" />
                <p className="folder-title">Email</p>
            </div>
        </div>
    )
};
